import classes from "./Class.module.css";
import React from "react";

function Class() {
  return (
    <div>
      <div className="font-link" style={{ marginLeft: "5%", marginTop: "10%" }}>
        Classes and Grades
      </div>

      <hr className={classes.hr} />
    </div>
  );
}

export default Class;
